INSERT INTO `purposes` VALUES (1,'---\n- Odit quisquam autem qui quaerat quia.\n- Blanditiis et id aut doloribus neque quia.\n'),(2,'---\n- Et fuga qui eos quidem sit.\n- Odio aliquam nam ab assumenda reiciendis sed perferendis.\n'),(3,'Ersatzstativ fr die Ausstellung.'),(4,'Ersatzstativ fr die Ausstellung.'),(5,'Ersatzstativ fr die Ausstellung.'),(6,'Est praesentium nulla nostrum amet ratione quas sed qui.'),(7,'Eaque voluptas ipsa molestiae blanditiis autem nesciunt a.'),(8,'Repudiandae numquam et quis est aperiam libero debitis iure.'),(9,'Laudantium consequuntur tenetur fuga.'),(10,'Eos consequatur molestias quaerat ut incidunt consequuntur repellat.'),(11,'Est autem tempore quisquam aut est expedita.'),(12,'Bentige ich fr die Aufnahmen meiner Abschlussarbeit.'),(13,'Magnam ab aut alias tenetur quos quaerat.'),(14,'Aperiam et adipisci dolorum ipsam quam quia dicta.'),(15,'Explicabo unde similique porro dignissimos cum.'),(16,'Ersatzstativ fr die Ausstellung.'),(17,'Fr das zweite Austellungswochenende.'),(18,'Fr das dritte Austellungswochenende.'),(19,'Fr die Abschlussarbeit.'),(20,'Ersatzstativ fr die Ausstellung.'),(21,'Um meine Abschlussarbeit zu fotografieren.'),(22,'Nulla architecto harum incidunt fugit sed aut libero totam.'),(23,'Um meine Abschlussarbeit zu fotografieren.'),(24,'Um meine Abschlussarbeit zu fotografieren.'),(25,'Paketausgabe'),(26,'Fr meinen aktuellen Kurs.'),(27,'Ersatzstativ fr die Ausstellung.'),(28,'Um meine Abschlussarbeit zu fotografieren.'),(29,'Ersatzstativ fr die Ausstellung.'),(30,'Ersatzstativ fr die Ausstellung.'),(31,'Ersatzstativ fr die Ausstellung.'),(32,'Ersatzstativ fr die Ausstellung.'),(33,'Ersatzstativ fr die Ausstellung.'),(34,'Ersatzstativ fr die Ausstellung.'),(35,'Ersatzstativ fr die Ausstellung.'),(36,'Ersatzstativ fr die Ausstellung.'),(37,'Ersatzstativ fr die Ausstellung.'),(38,'Fotoshooting (Kurs Fotografie).'),(39,'Brauche ich zwingend fr meinen Kurs.'),(40,'Ganz dringend bentigt fr meine Abschlussarbeit.'),(41,